const ARR_SIZE = INTERMEDIATE_A[0].length;

const PI = '314159265358979323846264338327950288419716939937510582097494459230781640628620899862803482534211706798214808651328230664709384460955058223172535940812848111745028410270193852110555964462294895493038196442881097566593344612847564823378678316527120190914564';

const getArrFromEmulator = (system) => {
  const arr = [];
  for (let i = 0, addr = 0x800; i < ARR_SIZE; i++, addr += 2) {
    arr.push(system.memory[addr] + (system.memory[addr + 1] << 8));
  }

  return arr;
};

(function main() {
  const { memory, sourceCode, symbols } = compileCodeForTest('spigot255.i8008', { sourceCodeWrapper: (code) => code });

  let res = '';
  let step = 0;
  const system = new Emulator({
    memoryDump: memory,
    ioOutputHandler: (({ data }) => {
      res += String(data);

      const realArr = getArrFromEmulator(system);
      const expectedArr = INTERMEDIATE_A[step - 1];
      if (PI.startsWith(res) && (realArr.join(' ') === expectedArr.join(' '))) {
        console.log(`Successfully obtained ${res.length} digits of Pi...`);
      } else {
        console.log(`Wrong digits of Pi has been computed: ${res}`);

        for (const [idx, val] of realArr.entries()) {
          const expected = expectedArr[idx];
          if (val !== expected) {
            console.log(`a[${idx}] is ${val}, while should be ${expected}`);
            break;
          }
        }

        console.log('Source code:');
        console.log(sourceCode);

        process.exit();
      }
    }),
  });

  const offsetForChecks = symbols.find(({ label }) => label === 'updatearray').offset;
  while (!system.isFinished) {
    if (system.registers.PC === offsetForChecks) {
      step++;
    }
    system.instruction();
  }

  if (res === PI) {
    console.log(`Correct digits of Pi has been received! ${res}`);
  } else {
    console.log(`Computed Pi is not real Pi! ${res}`);
  }

  console.log(`Elapsed ${system.tStates} states = ${statesToSeconds(system.tStates)}s`);
}());
